/** ./handle_me.less **/
.rounded_corners (@radius: 5px) {
    -moz-border-radius: @radius;
    -webkit-border-radius: @radius;
    border-radius: @radius;
}

.rounded_corners_leftside (@radius: 5px) {
    -webkit-border-bottom-left-radius: @radius;
    -moz-border-radius-bottomleft: @radius;
    border-bottom-left-radius: @radius;
    -webkit-border-top-left-radius: @radius;
    -moz-border-radius-topleft: @radius;
    border-top-left-radius: @radius;
}

.rounded_corners_rightside (@radius: 5px) {
    -webkit-border-bottom-right-radius: @radius;
    -moz-border-radius-bottomright: @radius;
    border-bottom-right-radius: @radius;
    -webkit-border-top-right-radius: @radius;
    -moz-border-radius-topright: @radius;
    border-top-right-radius: @radius;
}

/** ./handle_me.css **/
.icon-link span {
    opacity: 0.8;
    display: inline-block;
    padding: 3px 0 2px 22px;
    background: url("/static/lib.www.trunk.svn.freebase-site.googlecode.dev/template/img/ui-icons.png") no-repeat;
    line-height: 1;
    font-weight: bold;
}

#global-search-input {
    border: 1px solid #c1c1c1;
    -moz-border-radius: 4px;
    -webkit-border-radius: 4px;
    font-style: italic;
    font-family: "Helvetica Neue", Arial, Helvetica, sans-serif; 
    padding: 0.3em;
    font-size: 1.3em;
    width: 271px;
    font-size: 1.1em;
    background: #fff url("http://www.freebase.com/resources/images/ui/loader-sm-snake-orange.gif") 0 -100px;
}

@visited-blue: #1170a3;

